import {MapContainer, TileLayer, Marker, Popup} from 'react-leaflet';


const Marcadores = (props) => {
  return(
    <>
      {props.datos !== undefined && props.datos.length !== 0 ? (
      props.marcadores.map ((marcador,i) => {
          return (
              <>
                <Marker position={[marcador.posX,marcador.posY]}>
                    <Popup>
                      {marcador.cp}
                    </Popup>
                </Marker>
              </>
          );
      })
    ) : null}
    </>
  );
}




export const Mapa = (props) => {
  return (
    <>
    <MapContainer center={[43.0000000, -2.7500000]} zoom={8} scrollWheelZoom={false}>
      <TileLayer
        attribution='&copy; <a href="http://osm.org/copyright">OpenStreetMap</a> contributors'
        url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
      />
    </MapContainer>
    <Marcadores datos={props.datosMarcadores} />
    </>
    );
}

export default Mapa;
